export default function MessageBox(props) {

  const messageBoxRef = useRef(null)

  var createParticle = async (emoji) => {
    let particle = document.createElement('img')

    let randVal = Math.random()
    let size = randVal*(200 - 50) + 50
    let speed = (1-randVal)*2+1
    let zIndex = Math.round(randVal)
    let blur = randVal*4

    let left = Math.random()*80
    let delay = Math.random()*0.75
    let rotation = Math.random()*270-135

    particle.classList.add('particle')
    particle.style.setProperty('--rotation', `${rotation}deg`);
    particle.style.animationDuration = `${speed}s`
    particle.style.filter = `blur(${blur}px)`
    particle.style.left = `${left}%`
    particle.style.zIndex = zIndex*3 - 1
    particle.style.width = `${size}px`
    particle.style.height = `${size}px`
    particle.style.animationDelay = `${delay}s`
    particle.src = emoji

    messageBoxRef.current.appendChild(particle)

    setTimeout(() => {
      messageBoxRef.current.removeChild(particle)
    }, (speed+delay)*1000)

  }
  
  var clicked = async () => {
    let emoji = 'https://emojis.wiki/emoji-pics/facebook/eggplant-facebook.png'
    createParticle(emoji)
    createParticle(emoji)
    createParticle(emoji)
    createParticle(emoji)
    createParticle(emoji)

    emoji = 'https://emojipedia-us.s3.dualstack.us-west-1.amazonaws.com/thumbs/144/apple/232/splashing-sweat-symbol_1f4a6.png'
    createParticle(emoji)
    createParticle(emoji)
    createParticle(emoji)
    createParticle(emoji)
    createParticle(emoji)
  }

  return (
    <div ref={messageBoxRef} className='messageBoxContainer' >
      <div className='messageBox' style={{'--message-box-color': 'rgba(0, 154, 255, 0.6)'}}>
        {messageBlocks.map((messageBlock, i) => (
          <MessageBlock key={i} {...messageBlock} />
        ))}
      </div>
      <input type='text' className='messageInput' />
      <button onClick={clicked} >Click Me!</button>
    </div>
  )
}
